import React, {use, useEffect, useState} from 'react'
import Nav from '../Components/Nav'
function Accounts() {
    const [accountRaw, setAccountRaw] = useState([])
    useEffect(()=>{
        fetch('/api/accounts/')
        .then(r=>r.json())
        .then(data=>setAccountRaw(data))
    },[])
  return (
    <div>
        <Nav />
        Accounts
    </div>
  )
}

export default Accounts
